window.bookSummaryJSON = "<p><b>There is only one rule in hell: No one returns from the Rogue Arena.</b></p> <p>After fighting in the witches’ dark tournament and being condemned to death, Drake manages to flee the castle with Stella - but they are far from freedom. Now, they must return to Earth before it’s too late, and Stella has a plan. Accomplishing it won’t be easy, though.</p> <p>In a journey plagued with dangers and bizarre creatures, Drake and Stella will venture through the darkest side of hell, finding themselves in the heart of the Rogue Arena. A magical game held by a charming, yet evil prince. Except, this time, their souls are at stake. One wrong move, and they will lose everything they have fought for.</p> <p>Drake will risk everything to finally save Stella…even if it means being trapped in the Rogue Arena forever.</p> <p><b><i>Lost Paradise - Rogue Arena </i></b><b>is the highly anticipated second book in the Infernal Odyssey series. A heart-pounding tale full of supernatural adventure, love, and mind-blowing twists you will never guess. Get ready, because this audiobook will knock your socks off!</b></p>"; 
